import React from 'react';
import { useState } from 'react';

function Main() {
    const [contador, setContador] = useState(1);

    function contar() {
        setContador(contador++);
    }

    return (
        <div>
            <form>
                <label>Contador: {contador} </label>
                <button onClick={"contar()"} >Contar</button>
            </form>
        </div>
    );
}

export default Main;
